import React from "react";
import Post from "./Post/Post";
import { useSelector } from "react-redux";

const Posts = () => {

    const posts = useSelector((state) => JSON.stringify(state.posts.posts));
    console.log("this is posts: "+ JSON.parse(posts));
    return (
        <div>
            <Post post={posts[0]} /> 
        </ div>
    )
}

export default Posts;
